    "# Memories: Photo Management for Nextcloud\n\nMemories is a *batteries-included* photo management solution for Nextcloud with advanced features including:\n\n- **üì∏ Timeline**: Sort photos and videos by date taken, parsed from Exif data.\n- **‚è™ Rewind**: Jump to any time in the past instantly and relive your memories.\n- **ü§ñ AI Tagging**: Group photos by people and objects, powered by [recognize](https://github.com/nextcloud/recognize) and [facerecognition](https://github.com/matiasdelellis/facerecognition).\n- **üñºÔ∏è Albums**: Create albums to group photos and videos together. Then share these albums with others.\n- **ü´±üèª‚Äçü´≤üèª External Sharing**: Share photos and videos with people outside of your Nextcloud instance.\n- **üì± Mobile Support**: Works on devices of any shape and size through the web app.\n- **‚úèÔ∏è Edit Metadata**: Edit dates on photos quickly and easily.\n- **üì¶ Archive**: Store photos you don't want to see in your timeline in a separate folder.\n- **üìπ Video Transcoding**: Memories transcodes videos and uses HLS for maximal performance.\n- **üó∫Ô∏è Map**: View your photos on a map, tagged with accurate reverse geocoding.\n- **‚ö°Ô∏è Performance**: Memories is very fast.\n\n## üöÄ Installation\n\n1. Install the app from the Nextcloud app store (try a demo [here](https://memories-demo.radialapps.com/apps/memories/)).\n1. Perform the recommended [configuration steps](https://github.com/pulsejet/memories/wiki/Extra-Configuration).\n1. Run `php occ memories:index` to generate metadata indices for existing photos.\n1. Open the üì∑ Memories app in Nextcloud and set the directory containing your photos." : "# Eml√©kek: f√©nyk√©pkezel√©s a Nextcloudhoz\n\nAz Eml√©kek egy *teljes √©rt√©k≈±* f√©nyk√©pkezel≈ë megold√°s a Nextcloudhoz, t√∂bbek k√∂z√∂tt az al√°bbi speci√°lis funkci√≥kkal:\n\n- **üì∏ Id≈ëvonal**: F√©nyk√©pek √©s vide√≥k rendez√©se az Exif-adatokb√≥l kinyert felv√©teli d√°tum alapj√°n.\n- **‚è™ Visszateker√©s**: Azonnali visszaugr√°s a m√∫ltba, hogy √∫jra √°t√©lhesse az eml√©keit.\n- **ü§ñ MI-alap√∫ c√≠mk√©z√©s**: Emberekr≈ël √©s t√°rgyakr√≥l k√©sz√ºlt k√©pek csoportos√≠t√°sa a [Felismer√©s](https://github.com/nextcloud/recognize) √©s az [Arcfelismer√©s](https://github.com/matiasdelellis/facerecognition) alkalmaz√°sokra t√°maszkodva.\n- **üñºÔ∏è Albumok**: Albumok l√©trehoz√°sa a f√©nyk√©pek √©s vide√≥k csoportos√≠t√°s√°hoz. Majd ezek megoszt√°sa m√°sokkal.\n- **ü´±üèª‚Äçü´≤üèª K√ºls≈ë megoszt√°s**: F√©nyk√©pek √©s vide√≥k megoszt√°sa a Nextcloud-p√©ld√°nyon k√≠v√ºli emberekkel.\n- **üì± Mobilos t√°mogat√°s**: A webalkalmaz√°s seg√≠ts√©g√©vel tetsz≈ëleges alak√∫ √©s m√©ret≈± eszk√∂z√∂n m≈±k√∂dik.\n- **‚úèÔ∏è Metaadatok szerkeszt√©se**: F√©nyk√©pek d√°tum√°nak gyors √©s k√∂nny≈± szerkeszt√©se.\n- **üì¶ Arch√≠vum**: Azon k√©pek k√ºl√∂n mapp√°ban t√°rol√°sa, melyeket nem akar az id≈ëvonal√°n l√°tni.\n- **üìπ Vide√≥k √°tk√≥dol√°sa**: Az Eml√©kek √°tk√≥dolja a vide√≥kat, √©s HLS-t haszn√°l a maxim√°lis teljes√≠tm√©ny √©rdek√©ben.\n- **üó∫Ô∏è T√©rk√©p**: F√©nyk√©pek megtekint√©se t√©rk√©pen, pontos ford√≠tott geok√≥dol√°ssal.\n- **‚ö°Ô∏è Teljes√≠tm√©ny**: Az Eml√©kek rendk√≠v√ºl gyors.\n\n## üöÄ Telep√≠t√©s\n\n1. Telep√≠tse az alkalmaz√°st a Nextcloud alkalmaz√°st√°r√°b√≥l (pr√≥b√°ljon ki egy dem√≥t [itt](https://memories-demo.radialapps.com/apps/memories/)).\n1. V√©gezze el a javasolt [be√°ll√≠t√°si l√©p√©seket](https://github.com/pulsejet/memories/wiki/Extra-Configuration).\n1. Futtassa a `php occ memories:index` parancsot, hogy el≈ë√°ll√≠tsa a megl√©v≈ë f√©nyk√©pek metaadatindex√©t.\n1. Nyissa meg az üì∑ Eml√©kek alkalmaz√°st a Nextcloudban, √©s √°ll√≠tsa be a f√©nyk√©peit tartalmaz√≥ k√∂nyvt√°rat.",
